import { View, Text, Pressable, Image } from 'react-native'
import React from 'react'
import Ionicons from 'react-native-vector-icons/Ionicons';
import FontAwesomeIcons from 'react-native-vector-icons/FontAwesome5';
import { ProgressBar } from 'react-native-paper';


const CapacityVsData = ({navigation}) => {

    navigation.setOptions({
        headerTitle: () => (
          <View style={{ flexDirection: "row", alignItems: "center" }}>
            <Text className={"text-white text-lg font-semibold"}>Dung lượng và dữ liệu</Text>
          </View>
        ),
        headerStyle: {
          backgroundColor: "#0091FF",
          shadowColor: "#fff",
        },
        headerTintColor: "#fff",
        headerTitleStyle: {
          fontWeight: "bold",
          fontSize: 20,
        },
      });
    return (
        <View className={"items-center"}>
            <View className={"w-11/12 bg-white"}>
                <ProgressBar
                    style={{ height: 20, with: '100%' }}
                    progress={0.1}
                    color='#005ddc'
                ></ProgressBar>
                <View className={"flex-row justify-evenly w-4/6"}>
                    <View className={"flex-row items-center"}>
                        <Ionicons name="ellipse" size={10} color="#005ddc" />
                        <Text className={"px-2 text-gray-500 font-semibold"}>Zalo</Text>
                    </View>
                    <View className={"flex-row items-center"}>
                        <Ionicons name="ellipse" size={10} color="#5ba0fe" />
                        <Text className={"px-2 text-gray-500 font-semibold"}>Ứng dụng khác</Text>
                    </View>
                    <View className={"flex-row items-center"}>
                        <Ionicons name="ellipse" size={10} color="#cccccc" />
                        <Text className={"px-2 text-gray-500 font-semibold"}>Trống</Text>
                    </View>
                </View>
                <Text className={"font-semibold"}>Dữ liệu Zalo</Text>
               
            </View>
        </View>
    )
}

export default CapacityVsData
